categorytree-num-categories:
'''"C" is short for "Category".''' It must be as short as possible.

Number of sub-categories in a category. Appears in brackets after a name of an empty category.

Parameters:
* $1 - number of sub-categories. Can be used for PLURAL.

See also:
* {{msg-mw|Categorytree-num-pages}}
* {{msg-mw|Categorytree-num-files}}


{{Related|Categorytree-num}}

categorytree-num-pages:
'''"P" is short for "Pages".''' It must be as short as possible.

Number of pages in a category. Appears in brackets after a name of an empty category.

See also:
* {{msg-mw|Categorytree-num-categories}}
* {{msg-mw|Categorytree-num-files}}

Parameters:
* $1 - number of pages. Can be used for PLURAL.
{{Related|Categorytree-num}}

categorytree-num-files:
'''"F" is short for "Files".''' It must be as short as possible.

Number of files in a category. Appears in brackets after a name of a category.

See also:
* {{msg-mw|Categorytree-num-categories}}
* {{msg-mw|Categorytree-num-pages}}

Parameters:
* $1 - number of files. Can be used for PLURAL.
